class BizwizzTracker{constructor(t){this.endpointUrl="https://bizwizz.net/api/v1/bizwizztracker"}sendEvent(t,e){const n={name:t,data:e};fetch(this.endpointUrl,{method:"POST",headers:{"Content-Type":"application/json"},body:JSON.stringify(n)}).catch((t=>{console.error(`Failed to send event data: ${t}`)}))}}
